import React from 'react';
import logo from '../src/image/logo.png';
import Signup from './Signup';

const Header =()=>{

    return(
        <header>
        
        <figure>
        <img className="logo" src={logo} alt="logo" />
        </figure>
        <div className="title">
        <h1>E-Test</h1>
        </div>
        
    
        <nav className="navbar">
        <ul>
        <li>Home</li>
        <li>About us</li>
        <li><a href="<Signup/>">Sighn Up</a></li>
        <li>Login</li>
        </ul>
        </nav>
        
        </header>

    )
}

export default Header;
